import React from 'react'
import { menu } from './Menu'

let count = 0

const BoilerPlate = () => {
  return (
    <div className='w-full'>
      <h2 className="font-black text-white text-3xl py-8">Links</h2>
      <ul className='bg-[rgba(0,0,0,0.2)] py-10 px-36'>
        {
            menu.map(item => {
                <li key={count++} className="text-black">
                    <a href={item.link}>
                        {item.title}
                    </a>
                </li>
            })
        }
      </ul>
    </div>
  )
}

export default BoilerPlate
